// import Link from 'next/link';
import { 
    AppBar, 
    Toolbar, 
    Typography } from '@material-ui/core'
    

const NavBar = (props) => {
    return(
        <>
            <AppBar position='static' {...props}>
                <Toolbar style={{backgroundColor:'#00f'}}>
                    <Typography 
                        variant='h2' 
                        color='inherit' 
                        align='center' 
                        style={{color:'yellow', fontWeight:'bolder'}}>
                       Welcome to ClickMe'Guy!
                    </Typography>
                </Toolbar>
            </AppBar>
        </>
    )
} 
export default NavBar

